tables.table_schema:
CREATE TABLE trades (
 trade_id INT,
 security_id INT,
 quantity INT,
 price DECIMAL
);

CREATE TABLE compliance (
 compliance_id INT,
 trade_id INT,
 compliance_status VARCHAR(50),
 compliance_timestamp TIMESTAMP
);

CREATE TABLE traders (
    trader_id INT PRIMARY KEY,
    trader_name VARCHAR(255),
    designation VARCHAR(50),
    department VARCHAR(50)
);

CREATE TABLE compliance (
    compliance_id INT PRIMARY KEY,
    trade_id INT,
    is_trade_valid BOOLEAN,
    reason VARCHAR(255)
);
